DROP TABLE IF EXISTS cishfid.occupation_type CASCADE;
Drop sequence IF EXISTS cishfid.occupation_type_id_seq;


CREATE SEQUENCE IF NOT EXISTS cishfid.occupation_type_id_seq
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 250;


create table cishfid.occupation_type
(
    id bigint NOT NULL,
    stm_tp_cd text,
    cmpny_tp_cd integer,
    src_tbl_no integer,
    src_tbl_nme text,
    src_cat text,
    ocptn_src_tp_cd text,
    ocptn_src_tp_desc text,
    ocptn_entps_tp_cd integer,
    ocptn_tp_desc text,
    eff_dte text,
    exp_dte text,
    CONSTRAINT occupation_type_pkey PRIMARY KEY (id)
);


commit;